import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Header from "./header.js";
import "./index.css";

// ROUTES
import Home from "./home.js";
import About from "./about.js";

import Inventory from "./inventory.js";
import Financing from "./financing.js";
import TradeIn from "./trade-in.js";
import PayOnline from "./pay-online.js";
import ContactUs from "./contact-us.js";

function App() {
  return (
    <BrowserRouter>
      <Header />
      {/* <main> */}
      <Routes>
        <Route className="route" path="/home" element={<Home />}></Route>
        <Route className="route" path="/aboutus" element={<About />}></Route>
        <Route
          className="route"
          path="/inventory"
          element={<Inventory />}
        ></Route>
        <Route
          className="route"
          path="/financing"
          element={<Financing />}
        ></Route>
        <Route className="route" path="/tradein" element={<TradeIn />}></Route>
        <Route
          className="route"
          path="/payonline"
          element={<PayOnline />}
        ></Route>
        <Route
          className="route"
          path="/contact"
          element={<ContactUs />}
        ></Route>
      </Routes>
      {/* </main> */}
    </BrowserRouter>

    // <BrowserRouter
  );
}

export default App;
